// App.js

import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Calendar from './Calendar';

const App = () => {
  return (
    <Router>
      <div>
        <Switch>
          <Route path="/" exact>
            <h1>Home Page</h1>
            <a href="/calendar">Go to Calendar</a>
          </Route>
          <Route path="/calendar">
            <Calendar />
          </Route>
        </Switch>
      </div>
    </Router>
  );
};

export default App;
